// client/src/components/MitigationForm.js
import React, { useState } from "react";
import axios from "axios";

const MitigationForm = () => {
  const [formData, setFormData] = useState({
    customerName: "",
    jobAddress: "",
    claimNumber: "",
    jobType: "",
    paymentStatus: "",
    waitingInsurance: "",
  });

  const [rooms, setRooms] = useState([{ name: "", readings: "", photo: null }]);
  const [aiPsychrometrics, setAIPsychrometrics] = useState("");
  const [aiJobSummary, setAIJobSummary] = useState("");

  const handleFormChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  const handleRoomChange = (index, field, value) => {
    const updatedRooms = [...rooms];
    updatedRooms[index][field] = value;
    setRooms(updatedRooms);
  };

  const addRoom = () => {
    setRooms([...rooms, { name: "", readings: "", photo: null }]);
  };

  const generateAIforRoom = async (index) => {
    alert(`AI Room Summary will be generated for Room ${index + 1}`);
  };

  const generateAIpsychrometrics = async () => {
    setAIPsychrometrics("Generated Psychrometric Table (AI)...");
  };

  const generateAIJobSummary = async () => {
    setAIJobSummary("AI Final Insurance-Level Job Summary...");
  };

  const generatePDF = () => {
    alert("PDF Export Triggered! (Insurance-Level PDF Coming Soon)");
  };

  return (
    <div className="form-container">
      <h2 className="title">üõ† ToolbeltAI Mitigation Logger</h2>

      {/* JOB DETAILS */}
      <div className="section">
        <h3>üìç Job Information</h3>
        <input name="customerName" placeholder="Customer Name" onChange={handleFormChange} />
        <input name="jobAddress" placeholder="Job Address" onChange={handleFormChange} />
        <input name="claimNumber" placeholder="Claim Number" onChange={handleFormChange} />

        <select name="jobType" onChange={handleFormChange}>
          <option>Select Job Type</option>
          <option>Water Damage</option>
          <option>Fire Damage</option>
          <option>Mold Remediation</option>
          <option>Sewage Backup</option>
          <option>Storm Damage</option>
        </select>

        <select name="paymentStatus" onChange={handleFormChange}>
          <option>Select Payment Status</option>
          <option>Paid in Full</option>
          <option>Waiting on Insurance</option>
          <option>Denied / Collections</option>
          <option>Customer Financing</option>
        </select>

        <select name="waitingInsurance" onChange={handleFormChange}>
          <option>Waiting on Insurance?</option>
          <option>Yes</option>
          <option>No</option>
          <option>Partially Covered</option>
        </select>
      </div>

      {/* ROOMS SECTION */}
      <div className="section">
        <h3>üß± Rooms & Readings</h3>

        {rooms.map((room, index) => (
          <div key={index} className="room-card">
            <input placeholder="Room Name (e.g., Basement)" onChange={(e) => handleRoomChange(index, "name", e.target.value)} />
            <textarea placeholder="Moisture Readings" onChange={(e) => handleRoomChange(index, "readings", e.target.value)} />
            <input type="file" onChange={(e) => handleRoomChange(index, "photo", e.target.files[0])} />

            <button className="ai-btn" onClick={() => generateAIforRoom(index)}>‚öô Generate AI Room Summary</button>
          </div>
        ))}
        <button className="add-room-btn" onClick={addRoom}>‚ûï Add Another Room</button>
      </div>

      {/* PSYCHRO SECTION */}
      <div className="section">
        <h3>üå° Psychrometric Table</h3>
        <button onClick={generateAIpsychrometrics} className="ai-btn">‚öô Generate Psychrometric Table (AI)</button>
        {aiPsychrometrics && <div className="ai-box">{aiPsychrometrics}</div>}
      </div>

      {/* JOB SUMMARY */}
      <div className="section">
        <button onClick={generateAIJobSummary} className="ai-btn">üß† Generate Final Insurance Summary</button>
        {aiJobSummary && <div className="ai-box">{aiJobSummary}</div>}
      </div>

      {/* PDF EXPORT */}
      <div className="section">
        <button className="pdf-btn" onClick={generatePDF}>üìÑ Export Insurance-Level PDF</button>
      </div>
    </div>
  );
};

export default MitigationForm;
